var C_GET_NAME = 0;
var C_GET_N = 1;
var C_GET_P = 2;
var C_GET_C = 3;
var C_GET_A = 4;
var C_CMP_N = 11;
var C_CMP_P = 12;
var C_CMP_C = 13;
var C_CMP_A = 14;
var C_GET_FULL_CODE = 16;
var C_CHANGE_INIT = 0;
var C_CHANGE_NATION = 1;
var C_CHANGE_PROVINCE = 2;
var C_CHANGE_CITY = 3;
var C_CHANGE_AREA = 4;

function arrVal(str,level){
	switch(level){
		case C_GET_NAME:
			return str.substring(9,str.length);			
		case C_GET_N:
			return str.substring(0,2);
		case C_GET_P:
			return str.substring(2,4);
		case C_GET_C:
			return str.substring(4,6);
		case C_GET_A:
			return str.substring(6,8);
		case C_CMP_N:
			return str.substring(0,2) + "000000";		
		case C_CMP_P:
			return str.substring(0,4) + "0000";
		case C_CMP_C:
			return str.substring(0,6) + "00";
		case C_CMP_A:
			return str.substring(0,8);	
		case C_GET_FULL_CODE:
			return str.substring(0,8);
	}
}

function EzNPCAInit(){
	//把每个城市或区单元读取入内存
	var arr=npca_data.split(",");
	var cs_i=1;
	for (i=1;i<=arr.length;i++)
	{
		tmpArr = new Array();
		tmpArr[C_GET_NAME] = arrVal(arr[i-1],C_GET_NAME);
		tmpArr[C_GET_N] = arrVal(arr[i-1],C_CMP_N);
		tmpArr[C_GET_P] = arrVal(arr[i-1],C_CMP_P);
		tmpArr[C_GET_C] = arrVal(arr[i-1],C_CMP_C);
		tmpArr[C_GET_A] = arrVal(arr[i-1],C_CMP_A);
		//document.write(city_arr[i-1].substring(2,6)+"<br>");
		if(arr[i-1].substring(2,8)=="000000"){
			//加国
			ezNation.push(tmpArr);			
		}else if(arr[i-1].substring(4,8)=="0000"){
			//加省
			ezProvince.push(tmpArr);			
		}else if(arr[i-1].substring(6,8)=="00"){
			//加市
			ezCity.push(tmpArr);	
		}else{
			//加区
			ezArea.push(tmpArr);
		}
	}
}



//绑定
function EzNPCA(selCountry, selProvince, selCity, selArea, hidCountry, hidProvince, hidCity, hidArea){
	if(!isLoadedEzNPCA){//如果未初始化自动初始化
		EzNPCAInit();
		isLoadedEzNPCA=true;
		//alert(province);
		//alert(ezCity);
	}
	
	pca = new Object();
	pca.nation = selCountry;
	pca.province = selProvince;
	pca.city = selCity;
	pca.area = selArea;
	
	pca.hidNation = hidCountry;
	pca.hidProvince = hidProvince;
	pca.hidCity = hidCity;
	pca.hidArea = hidArea;
	
	selCountry.initOptions = InitDefaultOptions;
	selProvince.initOptions = InitDefaultOptions;
	selCity.initOptions = InitDefaultOptions;
	selArea.initOptions = InitDefaultOptions;
	
	selCountry.initOptions();
	selProvince.initOptions();
	selCity.initOptions();
	selArea.initOptions();
	
	//接管选择事件
	selCountry.onchange = onSelected;
	selProvince.onchange = onSelected;
	selCity.onchange = onSelected;
	selArea.onchange = onSelected;
	
	selCountry.pca = pca;
	selProvince.pca = pca;
	selCity.pca = pca;
	selArea.pca = pca;
	selCountry.level = C_CHANGE_NATION;
	selProvince.level = C_CHANGE_PROVINCE;	
	selCity.level = C_CHANGE_CITY;	
	selArea.level = C_CHANGE_AREA;

	//alert("构建 N:" + pca.nation.id + " P:" + pca.province.id + " C:" + pca.city.id + " A:" + pca.area.id);
	
	//初始化同步
	loadFromHidden(pca);
	return pca;
}


